DROP TABLE IF EXISTS restaurants CASCADE;
DROP TABLE IF EXISTS users CASCADE;
DROP TABLE IF EXISTS dishes CASCADE;
DROP TABLE IF EXISTS comments CASCADE;
DROP TABLE IF EXISTS streets CASCADE;
DROP TABLE IF EXISTS houses CASCADE;
DROP TYPE  IF EXISTS order_dish CASCADE ;
DROP TABLE IF EXISTS orders_internal CASCADE ;
DROP TABLE IF EXISTS statuses CASCADE;
DROP TABLE IF EXISTS orders CASCADE;
DROP TABLE IF EXISTS orders_internal CASCADE;
DROP TABLE IF EXISTS categori_restaurant CASCADE;
DROP TABLE IF EXISTS categories CASCADE;

create table restaurants
(
    id integer,
    name varchar(50) UNIQUE NOT NULL,
    image_path varchar(100) NOT NULL,
    slug varchar(50) UNIQUE NOT NULL,
    min_price int NOT NULL,
    up_time_to_delivery int NOT NULL,
    down_time_to_delivery int NOT NULL,
    -- agg_rating int,
    -- review_count int,
    categories varchar(50)[],
    review_count int,
    agg_rating int
);



ALTER TABLE restaurants ALTER COLUMN id SET NOT NULL;
ALTER TABLE restaurants ALTER COLUMN id ADD GENERATED ALWAYS AS IDENTITY;
ALTER TABLE restaurants ADD CONSTRAINT pkey_id  PRIMARY KEY(id);


-- -------------------------------CATEGORIES----------------------------------------  


create table categories
(
    id integer UNIQUE NOT NULL,
    name varchar(100) UNIQUE NOT NULL
);



ALTER TABLE categories ALTER COLUMN id SET NOT NULL;
ALTER TABLE categories ALTER COLUMN id ADD GENERATED ALWAYS AS IDENTITY;
ALTER TABLE categories ADD CONSTRAINT categori_pkey PRIMARY KEY(id);

-- -------------------------------CATEGORIES_RESTAURANT-------------------------------------------


create table categori_restaurant
(
    restaurant_id integer REFERENCES restaurants NOT NULL,
    categori_id integer REFERENCES categories NOT NULL
);


