CREATE OR REPLACE FUNCTION get_ru_date(date TIMESTAMP) RETURNS VARCHAR(30) AS $$
DECLARE
    month_str VARCHAR(30);
    BEGIN
        month_str = CASE to_char(date, 'MM') WHEN '01' THEN ' —è–Ω–≤–∞—Ä—è '
                        WHEN '02' THEN ' —Ñ–µ–≤—Ä–∞–ª—è '
                        WHEN '03' THEN ' –º–∞—Ä—Ç–∞ '
                        WHEN '04' THEN ' –∞–ø—Ä–µ–ª—è '
                        WHEN '05' THEN ' –º–∞—è '
                        WHEN '06' THEN ' –∏—é–Ω—è '
                        WHEN '07' THEN ' –∏—é–ª—è '
                        WHEN '08' THEN ' –∞–≤–≥—É—Å—Ç–∞ '
                        WHEN '09' THEN ' —Å–µ–Ω—Ç—è–±—Ä—è '
                        WHEN '10' THEN ' –æ–∫—Ç—è–±—Ä—è '
                        WHEN '11' THEN ' –Ω–æ—è–±—Ä—è '
                        WHEN '12' THEN ' –¥–µ–∫–∞–±—Ä—è '
                    END;
        RETURN to_char(date, 'DD')|| month_str || to_char(date, 'YYYY, HH24:MI');
    END;
$$ LANGUAGE plpgsql;

