-- --------------------------------------------------------DISHES--------------------------------------------------------------


create table dishes
(
    id integer PRIMARY KEY GENERATED ALWAYS AS IDENTITY,
    restaurant_id integer REFERENCES restaurants NOT NULL,
    name varchar(80) NOT NULL,
    description text,
    image_path text NOT NULL,
    calories integer,
    weight integer,
    price integer,
    category integer
);


-- ----------------------------USERS-------------------------------


CREATE TABLE users (
    id integer PRIMARY KEY GENERATED ALWAYS AS IDENTITY,
    name VARCHAR(256) NOT NULL,
    email VARCHAR(256)  CHECK (email ~* '^[A-Za-z0-9._+%-]+@[A-Za-z0-9.-]+[.][A-Za-z]+$') NOT NULL UNIQUE,
    phone NUMERIC(11) CHECK(phone>79000000000 and phone <80000000000) NOT NULL UNIQUE,
    avatar VARCHAR(256)
);



